import React from 'react';
import logo from '../../../assets/logo.png';
import style from './Logo.module.css';

const logoSpectre = () => {
    return (
        <div className={style.logoAlign}>
            <img src={logo} className={style.logo} alt="logo"/>
        </div>
    );
}

export default logoSpectre;
